import { jsPDF } from "jspdf";

export function addNotoSerifFontBold(doc: jsPDF) {
  // Adding the font data to jsPDF's VFS (Virtual File System)
  doc.addFileToVFS(
    "NotoSerif-VariableFont_wdth,wght.ttf",
    ""
  );

  // Registering the font with jsPDF
  doc.addFont(
    "NotoSerif_Condensed-Bold-normal.ttf",
    "NotoSerifBold",
    "Bold"
  );
}
